import React from 'react'
import { CircleImage } from './CircleImage'
import appetizer from "./img/appetizer.jpg"
import breakfast from "./img/breakfast.jpg"
import chicken from "./img/chicken.jpg"
import steak from "./img/steak.jpg"
import salad from "./img/salad.jpg"
import soup from "./img/soup.jpg"

export const BarList = (props) => {
    const data = [
        {title: "Appetizer Recipies", url: appetizer},
        {title: "Breakfast and Brunch Recipies", url: breakfast},
        {title: "Lunch Recipies", url: breakfast},
        {title: "Chicken Recipies", url: chicken},
        {title: "Steak Recipies", url: steak},
        {title: "Salad Recipies", url: salad},
        {title: "Soup Recipies", url: soup}
    ]
    return (
        <div className="bar-list-container" style={{display: 'flex', alignItems: 'center', padding: '32px 0px'}}>
            {data.map(({title, url}) => {
                return <CircleImage title={title} url={url}/>
            })}
        </div>
    )
}
